import React from "react";
import './content-card.scss'

export const ContentCard = () => {
    return (
        <div className='card'>
            <h2 className='card-title'>Title</h2>
            <p className='card-subtitle'>Language: <span>Java 1</span></p>
            <p className='card-subtitle'>Description: <span>Text text text text text text text text text text text text text</span>
            </p>
        </div>
    )
}
